name: onyx
description: ade, tomuss email pour lyon1

publish_to: 'none' # Remove this line if you wish to publish to pub.dev

version: 1.0.0

environment:
  sdk: ">=2.15.1 <3.0.0"

dependencies:
  flutter:
    sdk: flutter
  cupertino_icons: ^1.0.2
  date_picker_timeline: ^1.2.3
  calendar_timeline: ^1.0.4
  modal_bottom_sheet: #^2.0.1
    git:
      url: https://github.com/followthemoney1/modal_bottom_sheet.git
      ref: main
      path: modal_bottom_sheet

  mobile_scanner: ^2.0.0
  permission_handler: ^10.0.0
  flutter_bloc: ^8.0.0
  hive_flutter: ^1.1.0
  sizer: ^2.0.15
  webview_flutter: ^4.0.2
  workmanager: ^0.5.0
  flutter_local_notifications: ^13.0.0
  flutter_speed_dial: ^6.2.0
  device_info_plus: ^8.0.0
  connectivity_plus: ^3.0.2
  url_launcher: ^6.1.6
  path_provider: ^2.0.11
  file_picker: ^5.2.2
  open_filex: ^4.3.1
  flutter_file_dialog: ^3.0.0
  dartus:
    git: https://github.com/onyx-lyon1/dartus-tomuss-client.git
  lyon1mail:
    git: https://github.com/onyx-lyon1/lyon1-mailclient.git
  lyon1agenda:
    git: https://github.com/onyx-lyon1/lyon1-agendaclient.git
  izlyclient:
    git: https://github.com/onyx-lyon1/izlyclient.git
  flutter_map: ^3.0.0
  latlong2: ^0.8.1
  requests: ^4.7.0
  geolocator: ^9.0.2
  diacritic: ^0.1.3
  flutter_map_location_marker: ^5.0.0+1
  flutter_map_marker_popup: ^4.0.0
  convenient_test: ^1.2.1
  screenshot: ^1.3.0
  share_plus: ^6.3.0
  firebase_crashlytics: ^3.0.9
  firebase_core: ^2.4.1
  encrypt: ^5.0.1
  advance_expansion_tile: ^1.0.2
  auto_size_text: ^3.0.0


dependency_overrides:
  # unindent for devlopment to use local version of the libraries
  dartus:
    path: ../dartus-tomuss-client
  lyon1mail:
    path: ../lyon1-mailclient
  lyon1agenda:
    path: ../lyon1-agendaclient
  izlyclient:
    path: ../izlyclient

dev_dependencies:
  flutter_test:
    sdk: flutter
  integration_test:
    sdk: flutter
  flutter_lints: ^2.0.1
  build_runner: ^2.2.0
  hive_generator: ^2.0.0
  flutter_launcher_icons: ^0.11.0
  convenient_test_dev: ^1.2.1

flutter_icons:
  android: "launcher_icon"
  ios: true
  image_path: "assets/icon.png"
  min_sdk_android: 21 # android min sdk min:16, default 21
  web:
    generate: true
    image_path: "assets/icon.png"
    background_color: "#hexcode"
    theme_color: "#hexcode"
  windows:
    generate: true
    image_path: "assets/icon.png"
    icon_size: 48 # min:48, max:256, default: 48


flutter:
  uses-material-design: true
